CREATE PROCEDURE [dbo].[OperatorProductivity]  (@Website VARCHAR(255), @VisitorID INT , @StartDate DATETIME, @EndDate DATETIME)
AS
BEGIN
SELECT Distinct o.OperatorID, Name,
--Proactive Sent,
	(SELECT COUNT(*) 
	FROM Conversation C 
	INNER JOIN Messages M ON C.ConversationID = M.ConversationID 
	WHERE C.OperatorID = O.OperatorID
	AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
	AND C.Website = ISNULL(@Website, C.Website )
	AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
	AND M.MessageUserID = O.OperatorID
	AND M.MessageFrom = 'Operator'
	 AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
	) As ProactiveSent,

--Proactive Answered,
   --(SELECT COUNT(*) from 
	(SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = O.OperatorID
					AND M.MessageFrom = 'Operator'
					AND Exists (SELECT 1 FROM Messages VM WHERE  VM.MessageID > M.MessageID AND VM.ConversationID = M.ConversationID AND VM.MessageFrom = 'Visitor')
					 AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
					) 
					) As ProactiveAnswered,
-- Proactive Response Rate
CASE WHEN ((SELECT COUNT(*) 
	FROM Conversation C 
	INNER JOIN Messages M ON C.ConversationID = M.ConversationID 
	WHERE C.OperatorID = O.OperatorID
	AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
	AND C.Website = ISNULL(@Website, C.Website )
	AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
	AND M.MessageUserID = O.OperatorID
	AND M.MessageFrom = 'Operator'
	 AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
	) )> 0 THEN
	((SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = O.OperatorID
					AND M.MessageFrom = 'Operator'
					AND Exists (SELECT 1 FROM Messages VM WHERE  VM.MessageID > M.MessageID AND VM.ConversationID = M.ConversationID AND VM.MessageFrom = 'Visitor')
					 AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
					) 
					)* 100 /

	(SELECT COUNT(*) 
	FROM Conversation C 
	INNER JOIN Messages M ON C.ConversationID = M.ConversationID 
	WHERE C.OperatorID = O.OperatorID
	AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
	AND C.Website = ISNULL(@Website, C.Website )
	AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
	AND M.MessageUserID = O.OperatorID
	AND M.MessageFrom = 'Operator'
	 AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
	))ELSE 0 END  As ProactiveResponseRate,


--Reactive Received
	(SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = C.VisitorID
					AND M.MessageFrom = 'Visitor'
					AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)

					)) As ReactiveReceived,

--Reactive Answered
	(SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = C.VisitorID
					AND M.MessageFrom = 'Visitor'
					AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
					AND Exists (SELECT 1 FROM Messages VM WHERE VM.MessageID > M.MessageID AND VM.ConversationID = M.ConversationID AND VM.MessageFrom = 'Operator')
					)) As ReactiveAnswered,

--Reactive Response Rate
CASE WHEN (SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = C.VisitorID
					AND M.MessageFrom = 'Visitor'
					AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)

					))>0 THEN
--Reactive Answered
	(SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = C.VisitorID
					AND M.MessageFrom = 'Visitor'
					AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)
					AND Exists (SELECT 1 FROM Messages VM WHERE VM.MessageID > M.MessageID AND VM.ConversationID = M.ConversationID AND VM.MessageFrom = 'Operator')
					)) * 100 /
		(SELECT COUNT(*) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID 
		AND C.VisitorID = ISNULL(@VisitorID, C.VisitorID )
		AND C.Website = ISNULL(@Website, C.Website )
		AND C.StartDate>= ISNULL(@StartDate, CONVERT(DATETIME, '1900-01-01 00:00:00.000'))
	    AND C.StartDate<= ISNULL(@EndDate, CONVERT(DATETIME, getdate()))
		AND Exists (SELECT 1 FROM Messages M 
					WHERE M.ConversationID = C.ConversationID
					AND M.MessageUserID = C.VisitorID
					AND M.MessageFrom = 'Visitor'
					AND M.MessageID = (SELECT Min(IM.MessageID) FROM Messages IM WHERE IM.ConversationID = M.ConversationID)					

					)) ELSE 0 END As ReactiveResponseRate,

--Total Chat Length
	(SELECT SUM(DATEDIFF(minute, StartDate,EndDate)) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID ) As TotalChatLength,
--Average Chat Length
	(SELECT AVG(DATEDIFF(minute, StartDate, EndDate)) FROM Conversation C 
		WHERE C.OperatorID = O.OperatorID ) As AverageChatLength

FROM Operator O
 --left join Conversation cc on cc.OperatorID=o.OperatorID
 where  1=1

 --and cc.VisitorID= CASE WHEN @VisitorID is null then cc.VisitorID 
 -- if @VisitorID  = null then and cc.VisitorID = ISNULL end if
 
--  and  ( cc.VisitorID = ISNULL(@VisitorID, cc.VisitorID )
-- or    cc.VisitorID is ISNULL(@VisitorID, null )) 

  -- arCategory = CASE WHEN @varCategory IS NULL THEN varCategory ELSE @varCategory END 
-- Group by O

END

